import React from 'react';
import HomeIcon from '@mui/icons-material/Home';
import FoundationIcon from '@mui/icons-material/Foundation';
import Person4Icon from '@mui/icons-material/Person4';


export const sidebarData = [
    { 
        title: "Home",
        icon: <HomeIcon />, 
        link: "", 
    }, 
    { 
        title: "Home2", 
        icon: <FoundationIcon />, 
        link: "/home2", 
    }, 
    { 
        title: "Home3", 
        icon: <FoundationIcon />, 
        link: "/home3", 
    }, 
    { 
        title: "Account", 
        icon: <Person4Icon />, 
        link: "/account",
    },
];
